function postForm(n){var t=document.querySelector(n),r=t.getAttribute("action"),u=t.getAttribute("method"),f=new FormData(t),i=new XMLHttpRequest;i.open(u,r,!1);try{return i.send(f),i.responseText}catch(e){return{success:!1,message:"Network error"}}}window.clipboardCopy={copyText:function(n,t,i){var r=document.getElementById(n),u=r.value;navigator.clipboard.writeText(u).then(function(){var n=document.getElementById(t);n.innerHTML=i;setTimeout(()=>{n.innerHTML=""},2500)}).catch(function(n){alert(n)})}};